window.bookSummaryJSON = "<p>From <i>New York Times</i> best-selling author Kristen Ashley comes the long-awaited story of Daisy and Marcus, <i>Rock Chick Reawakening</i>. A prequel to Kristen's Rock Chick series, <i>Rock Chick Reawakening</i> shares the tale of the devastating event that nearly broke Daisy, an event that set Marcus Sloan - one of Denver's most respected businessmen and one of the Denver underground's most feared crime bosses - into finally making his move to win the heart of the woman who stole his. </p>"; 
